import medog from '../assets/jpg/me_dog.jpg';

export const aboutData = {
    title: "Who I am",
    description1: "My name's Shreya Sharma. I'm a software and machine learning developer based in Baltimore, MD, USA. Born and brought up in New Delhi, India, I started my coding journey at IIIT Delhi, where I completed my Bachelors in Computer Science in 2019. I worked as a Senior Software Developer at MakeMyTrip, India's leading travel-based e-commerce platform. On the side I kept following my passion in Machine Learning and NLP by working as a Research Assistant at IIIT Delhi. After 3 years of developing Sping-Boot and Django services at MMT, I came to the States to follow my passion in Machine Learning. At Johns Hopking University, I am pursuing mu Masters in CS and working on exciting projects in the domain of NLP at the Center for Language and Speech Processing.",
    description2:<p>When I am not coding, I am drawing, meeting my friends, travelling, and watching all kinds of TV shows and movies. I am a true Bollywood fan and love to say Hi to any dog that comes my way :) <br/><br/> PS this isn't my doggo (his name is Lincoln).</p>,
    image: medog
}
